import React, { useEffect, useState } from "react";
import { styled } from "styled-components";
import "../css/order.css";
import axios from "axios";
const siparisDetayiInitial = {
  siparisNotu: "",
  boyut: "",
  hamur: "",
  ekMalzemeler: [],
};
const OrderConfirmed = () => {
  const [siparisDetayi, setSiparisDetayi] = useState(siparisDetayiInitial);

  const ContainerDiv = styled.div`
    width: 45%;
    margin: auto;
    text-align: center;
  `;
  const SummaryDiv = styled.div`
    border: 0.08rem solid white;
    width: 45%;
    display: flex;
    flex-direction: column;
    margin: auto;
    padding: 1rem;
  `;
  const Summary1 = styled.div`
    display: flex;
    justify-content: space-between;
  `;
  const Summary2 = styled.div`
    display: flex;
    justify-content: space-between;
  `;
  const DetailsDiv = styled.div`
    display: flex;
    justify-content: flex-start;
    gap: 0.25rem;
    & p:nth-child(1) {
      font-weight: bold;
    }
  `;
  const P = styled.p`
    font-family: "Barlow", sans-serif;
    font-size: 3rem;
  `;
  const Pl = styled.p`
    font-family: "Satisfy", cursive;
    color: #fdc913;
    margin-bottom: 0;
    font-size: 1.5rem;
  `;

  axios.get("https://httpbin.org/post").then((res) => console.log(res));
  return (
    <div>
      <div className="order">
        <ContainerDiv className="container">
          <Pl>Lezzetin yolda</Pl>
          <P>SİPARİŞ ALINDI</P>
        </ContainerDiv>
      </div>
    </div>
  );
};
export default OrderConfirmed;
